import React, { useEffect, FC } from 'react';
import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { RootState } from '../../components/store';
import { useNavigate } from 'react-router-dom';
import Product from '../../types/types';
import Header from "../../components/Header";
import Box from "../../components/Box";
import Footer from "../../components/Footer";
import { DivSucesso, Back } from './styles';

const PurchaseSuccessPage = () => {
  interface Product {
    id: number;
    name: string;
    price: number;
    description: string;
    category: string;
    quantity: number;
  }
  const Cart: React.FC = () => {
    const products = useSelector((state: RootState) => state.cart.products);
    const productList = Object.values(products);
    return (
      <div>

        <Header />

        <DivSucesso>
            <h1>Compra realizada com sucesso!</h1>
            <p>Obrigado por fazer sua compra.</p>
            <p>Seu pedido foi processado e em breve ser√° enviado.</p>
    
            <Back as = {Link} to="/produtos">Continuar comprando</Back>
        </DivSucesso>

        <div>
            {productList.map((product: Product) => (
              <li key={product.id}>
                <div>
                  <h1>{product.name}</h1>
                  <p><strong>$ {product.price} </strong> cada</p>
                </div>
              </li>
            ))}
        </div>


        <Footer />
      </div>
    );
  };
}
  export default PurchaseSuccessPage;
